import React from 'react'
import ExpensesItem from './ExpensesItem'
function Expenses(props){
  
   
 
    

    return(
        
        <div>
            
        <ExpensesItem title = {props.item[0].title} amout = {props.item[0].amout} date = {props[0].date}/>
        <ExpensesItem title = {props[1].title} amout = {props[1].amout} date = {props[1].date}/>
        </div>
       
        
    )

}
export default Expenses
